import "./App.css";

import { ThemeProvider, createTheme } from "@mui/material/styles";

import Header from "./components/Header";

function App() {
  const theme = createTheme({
    components: {
      MuiTypography: {
        styleOverrides: {
          root: {
            whiteSpace: "nowrap",
          },
        },
      },
    },
    typography: {
      fontFamily: "Nanum Gothic",
    },
    palette: {
      primary: {
        main: "#556cee",
      },
      secondary: {
        main: "#909ff1",
      },
    },
  });

  return (
    <div style={{ minWidth: "300px" }}>
      <ThemeProvider theme={theme}>
        <Header />
      </ThemeProvider>
    </div>
  );
}

export default App;
